import React from 'react';
import './SearchBoxStyles.css';

const ClassicalSearchBox = () => (
	<div id="cover">
	  <form method="get" action="">
	    <div className="tb">
	      <div className="td">
	      	<input type="text" placeholder="Search for Classical Music" required />
	      </div>
	      <div className="td" id="s-cover">
	        <button type="submit">
	          <div id="s-circle"></div>
	          <span></span>
	        </button>
	      </div>
	    </div>
	  </form>
	</div>
)

export default ClassicalSearchBox;




